    "import matplotlib.pyplot as plt\n",
    "import numpy as np\n",
    "classes=['python','ai','ml','r']\n",
    "c1stud=[23,12,45,32]\n",
    "c2stud=[12,21,32,43]\n",
    "classes_index=np.arange(len(classes))\n",
    "width=0.2\n",
    "plt.bar(classes_index,c1stud,width,label='class 1',color='r')\n",
    "plt.bar(classes_index+ width,c2stud ,width,label='class 2',color='g')\n",
    "#plt.xticks(classes_index+ width,classes,rotation=20)\n",
    "plt.title('students details')\n",
    "plt.xlabel('no. of students')\n",
